		$uid = $_POST['uid'];
		$pwd = $_POST['pwd'];
		$db = $_POST['db'];
	}
	$conn = mysql_connect($host,$uid,$pwd);
	if (!$conn) {
		echo mysql_error().'<br/>';
		vConn();
		exit();
	} 
	mysql_select_db($db,$conn);
	if (mysql_errno($conn) != 0) {
		echo mysql_error().'<br/>';
		vConn();
		exit();
	}
	$_SESSION['host'] = $host;
	$_SESSION['uid'] = $uid;
	$_SESSION['pwd'] = $pwd;
	$_SESSION['db'] = $db;
